import React from 'react'
const Navbar = () => {
    return(
        <div className='navbar'>
            <span className='logo'>Axon Chat</span>
            <div className='user'>
                <img src="https://www.pexels.com/photo/model-in-summer-dress-and-hat-17041991/" alt=""/>
                <span>Varsha</span>
                <button>logout</button>
            </div>
        </div>
    )
}
export default Navbar;
